apiVersion: ec2.aws.m.upbound.io/v1beta1
kind: Subnet
metadata:
  name: with-ipam-private-a
  annotations:
    crossplane.io/composition-resource-name: subnet-private-a
    gotemplating.fn.crossplane.io/composition-resource-name: subnet-private-a
status:
  conditions:
    - type: Ready
      status: "True"
    - type: Synced
      status: "True"
  atProvider:
    id: subnet-priv-a-0123456789
    arn: arn:aws:ec2:us-east-1:123456789012:subnet/subnet-priv-a-0123456789
    vpcId: vpc-0123456789abcdef0
    cidrBlock: "10.100.0.0/20"
    ipv6CidrBlock: "fd00:100:0:1::/64"
    availabilityZone: us-east-1a
    availabilityZoneId: use1-az1
    mapPublicIpOnLaunch: false
